import "../styles/footer.css";

export function Footer() {
  return (
    <footer className="footer">
      <div>
        <h4>Del</h4>
        <p>
          Somos una heladería que combina la verdadera receta italiana del
          helado con tecnología de última generación para elaborar helados de
          excelencia 100%
        </p>
      </div>
      <div></div>
      <div></div>
    </footer>
  );
}
